<span class="line"><span style="color:#A6ACCD;">-f, --inactive INACTIVE      </span><span style="color:#676E95;"># \u5BC6\u7801\u8FC7\u671F\u540E\u5230\u5E10\u6237\u88AB\u6C38\u4E45\u7981\u7528\u7684\u5929\u6570\u3002</span></span>
